. 
Attention! ⚠
New fantastic product alert!👌🚨
. 
People who keep asking about natural options for cleansing and conditioning hair... Tada! 🎉 
Arappu powder, Chigare powder (ಚಿಗರೆ ಪುಡಿ) in Kannada is here! 😍
. 
Albizia Amara is a drought-resistant tree found in South India & Sri Lanka, which has tiny leaves like the tamarind tree. Arappu powder is made by grinding the sundried leaves of this tree. 🌿🍃
. 
Arappu powder removes dirt, grime and oil. It has a conditioning effect on the scalp and cools the body. This is a traditional way of washing hair after a nice hot oil massage. Arappu powder is usually mixed with shikakai powder to get good lather. People allergic to shikakai powder can use just arappu powder as well. 💆🛀
. 
Arappu powder is known to prevent dandruff, premature greying of hair, gives a cooling effect to your eyes while washing your hair/face. It is a locally sourced, 100% natural and chemical free product. 💯✨
. 
Instructions to use: 
Take about 2-3 spoons of Arappu powder (quantity depends on the length and thickness of hair), mix it in enough water and make sure there aren't any lumps. Apply on your scalp and hair, gently massage your scalp for a bit and wash with lukewarm water. 
This Arappu powder is finely powdered, so there won't be any bits sticking to your hair.👌
. 
DM to place an order!📱📩
. 
P. S. We used to use a mixture of shikakai powder, besan and chigare powder to wash our hair and body (with water heated in an 'ande' using dried coconut peels and shells after applying oil on the scalp and body and sunbathing on the terrace for a couple of hours) almost every Sunday  while growing up. 😊💭
. 
